description:
Atualmente o emissor Crefisa utiliza o arquivo de PLD (prevenção de lavagem de dinheiro) com base no modelo de arquivo da empresa Advice Technology & Knowledge.
O PDL é um arquivo de Prevenção de Lavagem de Dinheiro utilizado que contempla informações dos titulares dos cartões destinada à execução de transações de pagamento em moeda eletrônica realizadas com base em fundos denominados em reais previamente aportados; 
Será detalhado neste documento os campos que compõe o arquivo, seu conceito e forma de geração, com base no layout da empresa Advice.
